import React from 'react';
import styled from 'styled-components';
import info from '../data.json'
const Header = () => {
    return (
        <HeaderContainer>
      
            <h1>{info.fullName}</h1>
            <h1>header</h1>
        </HeaderContainer>
    );
}

export default Header;

const HeaderContainer=styled.div`
display: flex;
;
background-color: red;
`
